// src/pages/DogRunPage.tsx
import React, { useState } from "react";
import { Link, useParams } from "react-router-dom";
import "./DogRunPage.css";

const options = ["駐車場あり", "人工芝生", "天然芝生", "利用料金無料", "営業24時間", "大型犬OK"];

// DogRunDetailPage コンポーネント（都道府県別のページ）
const DogRunDetailPage: React.FC = () => {
  const { prefecture } = useParams<{ prefecture: string }>();
  const [selectedOptions, setSelectedOptions] = useState<string[]>([]);

  const handleOptionClick = (option: string) => {
    setSelectedOptions((prevSelected) => 
      prevSelected.includes(option)
        ? prevSelected.filter((item) => item !== option) // 選択済みのオプションを削除
        : [...prevSelected, option] // 新しいオプションを追加
    );
  };

  return (
    <div className="dogrun-detail-page">
      <h1>Dog run - {prefecture}</h1> {/* 選択された都道府県を表示 */}
      <p>希望条件を選択してください:</p>
      <div className="options-container">
        {options.map((option) => (
          <button
            key={option}
            onClick={() => handleOptionClick(option)}
            className={selectedOptions.includes(option) ? "selected" : ""}
          >
            {option}
          </button>
        ))}
      </div>
      <div className="selected-options">
        <h3>選択された条件:</h3>
        <ul>
          {selectedOptions.length > 0 ? (
            selectedOptions.map((option) => <li key={option}>{option}</li>)
          ) : (
            <p>条件が選択されていません</p>
          )}
        </ul>
      </div>
    </div>
  );
};

// DogRunPage コンポーネント（都道府県を選ぶメインページ）
const DogRunPage: React.FC = () => {
  const [isDropdownVisible, setIsDropdownVisible] = useState(false);

  const toggleDropdown = () => {
    setIsDropdownVisible(!isDropdownVisible);
  };

  return (
    <div className="dogrun-page">
      <header className="header">wan paradise</header>
      <div className="tab-container" onClick={toggleDropdown}>
        <span>全国のドッグランを探す</span>
      </div>
      {/* ドロップダウンメニューの表示 */}
      {isDropdownVisible && (
        <div className="dropdown-menu">
          <ul>
            <li><Link to="/dogrun/Hokkaido">北海道</Link></li>
            <li><Link to="/dogrun/tohoku">東北</Link></li>
            <li><Link to="/dogrun/kanto">関東</Link></li>
            <li><Link to="/dogrun/chubu">中部</Link></li>
            <li><Link to="/dogrun/kansai">関西</Link></li>
            <li><Link to="/dogrun/chugoku">中国</Link></li>
            <li><Link to="/dogrun/shikoku">四国</Link></li>
            <li><Link to="/dogrun/kyushu">九州</Link></li>
            <li><Link to="/dogrun/okinawa">沖縄</Link></li>
          </ul>
        </div>
      )}
    </div>
  );
};

export { DogRunPage, DogRunDetailPage };
